import React, { useState } from 'react';
import './Dashboard.css';
import Button from '@mui/material/Button';

const Dashboard = () => {
  const [buttonPosition, setButtonPosition] = useState({ top: 20, right: 20 });

  const handleMoveButton = (direction) => {
    let newPosition = { ...buttonPosition };

    if (direction === 'up') {
      newPosition.top -= 20;
    } else if (direction === 'down') {
      newPosition.top += 10;
    } else if (direction === 'left') {
      newPosition.right -= 10;
    } else if (direction === 'right') {
      newPosition.right += 10;
    }

    setButtonPosition(newPosition);
  };

  return (
    <div className='dashboard-bg'>
      <div className="deposit-button-container" style={{ position: 'relative', ...buttonPosition }}>
        <Button
          type="submit"
          fullWidth
          variant="contained"
          sx={{ width: '250px', height: '50px', backgroundColor: '#FFCC00', color: '#000000', alignSelf: 'flex-end' }}
        >
          Deposit
        </Button>
      </div>

      <div className="button-controls">
        <Button variant="outlined" onClick={() => handleMoveButton('up')}>Up</Button>
        <Button variant="outlined" onClick={() => handleMoveButton('down')}>Down</Button>
        <Button variant="outlined" onClick={() => handleMoveButton('left')}>Left</Button>
        <Button variant="outlined" onClick={() => handleMoveButton('right')}>Right</Button>
      </div>
    </div>
  );
};

export default Dashboard;
